import React from 'react'
import Header from '../components/Header-Perfil'
import PerfilText from '../components/P';
import GlobalStyle from '../styles/GlobalStyles'

function Perfil(){
    return(
        <div>
        <GlobalStyle />
            <Header />
            <PerfilText />
        </div>
    );
}
export default Perfil;
